message: "먹튀사이트 검증사이트 먹튀폴리스입니다.\r\n먹튀폴리스는 신규는 물론 오픈된 먹튀사이트를 철저히 먹튀검증하여 \r\n먹튀없는 시대를 만들어가고 있습니다. 먹튀폴리스를 사랑하는 여러분의 많은 호응바랍니다.\r\n여러분의 충실한 먹튀검증 사이트가 되도록 노력하겠습니다."
